import './Card.css';

const DeepTable = ({ e }) => {

  return (
    <article className='team-position'>
      <div className='mob_info'>{e.position}</div>
      <div className='mob_info'>{e.team.name}</div>
      <div className='mob_info'>{e.playedGames}</div>
      <div >{e.won}</div>
      <div>{e.draw}</div>
      <div>{e.lost}</div>
      <div>{e.goalsFor}</div>
      <div>{e.goalsAgainst}</div>
      <div className='mob_info'>{e.goalDifference}</div>
      <div className='mob_info'>{e.points}</div>
    </article>
  )
};

export default DeepTable;
